import tkinter as tk
from tkinter import filedialog
import struct
import os
import math
import platform
import pygame
import base64
import io

# Internal Sound
DING_WAV = b"""<>"""
CLICK_WAV = b"""<>"""
JAM_WAV = b"""<>"""

def load_sound(encoded_bytes):
    decoded = base64.b64decode(encoded_bytes)
    return pygame.mixer.Sound(io.BytesIO(decoded))


class Float32Trainer:

    def __init__(self, root):
        self.root = root
        self.root.title("Float32, SignedInt16 Trainer v1.1")
        self.center_window(1120, 800)
        self.data = b''
        self.offset = 0
        self.log_path = None
        self.last_save_type = None
        self.log_lines = []
        self.last_logged_offset = None

        self.output_format = tk.StringVar(value="Clean output")
        self.step_mode = tk.StringVar(value="Default 1 Step")
        self.offset_mode = tk.StringVar(value="Not write offsets")

        pygame.mixer.init()
        self.sfx_click = load_sound(CLICK_WAV)
        self.sfx_ding = load_sound(DING_WAV)
        self.sfx_jam = load_sound(JAM_WAV)

        self.load_file()
        self.setup_ui()
        self.refresh()

        self.root.bind('<Left>', lambda e: self.move_left(self.get_step()))
        self.root.bind('<Right>', lambda e: self.move_right(self.get_step()))
        self.root.bind('<Shift-Left>', lambda e: self.move_left(4))
        self.root.bind('<Shift-Right>', lambda e: self.move_right(4))
        self.root.bind('<Control-Left>', lambda e: self.move_left(2))
        self.root.bind('<Control-Right>', lambda e: self.move_right(2))
        self.root.bind('<Up>', lambda e: self.save_float())
        self.root.bind('<Down>', lambda e: self.save_int16())

    def get_step(self):
        return {"Default 1 Step": 1, "2 Steps": 2, "4 Steps": 4}.get(self.step_mode.get(), 1)
        
    def center_window(self, width, height):
        screen_width = self.root.winfo_screenwidth()
        screen_height = self.root.winfo_screenheight()
        x = (screen_width // 2) - (width // 2)
        y = (screen_height // 2) - (height // 2)
        self.root.geometry(f"{width}x{height}+{x}+{y}")

    def add_menu(self):
        menubar = tk.Menu(self.root)
        file_menu = tk.Menu(menubar, tearoff=0)
        file_menu.add_command(label="Save & Exit", command=self.save_offset_and_exit)
        file_menu.add_command(label="Magic Float32", command=self.magic_float32)
        menubar.add_cascade(label="File", menu=file_menu)
        self.root.config(menu=menubar)

    def magic_float32(self):
        if not self.data:
            return

        output_lines = []
        last_type = None
        last_end = 0
        i = 0
        while i + 4 <= len(self.data):
            chunk = self.data[i:i+4]
            try:
                val = struct.unpack('<f', chunk)[0]
                if math.isnan(val) or abs(val) < 1e-8 or not -96.0 < val < 96.0:
                    raise ValueError
                if last_end < i:
                    gap = self.data[last_end:i]
                    if gap:
                        prefix = self.format_with_prefix("Hexcode", last_end)
                        output_lines.append(prefix + ' '.join(f"{b:02x}" for b in gap))
                prefix = self.format_with_prefix("Float32", i) if last_type != 'float' else ""
                if last_type == 'float':
                    output_lines[-1] += f", {val:.8f}"
                else:
                    output_lines.append(prefix + f"{val:.8f}")
                last_type = 'float'
                last_end = i + 4
                i += 4
            except:
                i += 1
                last_type = None

        if last_end < len(self.data):
            gap = self.data[last_end:]
            if gap:
                prefix = self.format_with_prefix("Hexcode", last_end)
                output_lines.append(prefix + ' '.join(f"{b:02x}" for b in gap))

        if self.log_path:
            magic_path = self.log_path.replace("_log.txt", "_magic32.txt")
            with open(magic_path, 'w') as f:
                f.write('\n'.join(output_lines))
                
    def save_offset_and_exit(self):
        if self.log_path:
            save_path = self.log_path.replace("_log.txt", "_save.txt")
            with open(save_path, 'w') as f:
                f.write(str(self.offset))
        self.root.quit()

    def load_file(self):
        path = filedialog.askopenfilename(filetypes=[("Binary files", "*.bin"), ("All files", "*")])
        if not path:
            self.root.destroy()
            return
        with open(path, 'rb') as f:
            self.data = f.read()
        self.offset = 0
        self.log_path = os.path.splitext(path)[0] + "_log.txt"

        # Try load save file
        save_state_path = os.path.splitext(path)[0] + "_save.txt"
        if os.path.exists(save_state_path):
            try:
                with open(save_state_path, 'r') as sf:
                    saved_offset = int(sf.read().strip())
                    if 0 <= saved_offset < len(self.data):
                        self.offset = saved_offset
            except:
                pass

        self.log_lines = []
        self.last_save_type = None
        self.last_logged_offset = None

    def setup_ui(self):
        self.offset_label = tk.Label(self.root, text="="*48 + " Offset " + "="*48, font=('Courier', 18))
        self.offset_label.pack()

        self.hex_display = tk.Text(self.root, height=1, width=101, font=('Courier', 18), bg="black", fg="gray", bd=0)
        self.hex_display.pack(pady=5)
        self.hex_display.config(state=tk.DISABLED)

        self.float_label = tk.Label(self.root, text="="*48 + " Float " + "="*48, font=('Courier', 18))
        self.float_label.pack()

        self.float_value = tk.Label(self.root, text="", font=('Courier', 18))
        self.float_value.pack(pady=5)

        self.SignedInt_label = tk.Label(self.root, text="="*46 + " SignedInt " + "="*46, font=('Courier', 18))
        self.SignedInt_label.pack()

        self.int16_value = tk.Label(self.root, text="", font=('Courier', 18))
        self.int16_value.pack(pady=5)

        self.log_display = tk.Text(self.root, height=30, width=170, wrap='none', font=('Courier', 18), bg='#f0f0f0')
        self.log_display.pack(pady=5)
        self.log_display.config(state=tk.DISABLED)

        control_frame = tk.Frame(self.root)
        control_frame.pack(pady=5)

        tk.Label(control_frame, text="Output Format:", font=('Courier', 14)).grid(row=0, column=0, padx=10)
        self.output_format = tk.StringVar(value="Create table")        
        tk.OptionMenu(control_frame, self.output_format, "Clean output", "Create table").grid(row=0, column=1)

        tk.Label(control_frame, text="Step Mode:", font=('Courier', 14)).grid(row=0, column=2, padx=10)
        self.step_mode = tk.StringVar(value="Default 1 Step")
        tk.OptionMenu(control_frame, self.step_mode, "Default 1 Step", "2 Steps", "4 Steps").grid(row=0, column=3)

        tk.Label(control_frame, text="Offset Mode:", font=('Courier', 14)).grid(row=0, column=4, padx=10)
        self.offset_mode = tk.StringVar(value="Write offsets Hex")
        tk.OptionMenu(control_frame, self.offset_mode, "Not write offsets", "Write offsets Bytes", "Write offsets Hex").grid(row=0, column=5)
        
        self.add_menu()

    def move_left(self, step):
        if self.offset >= step:
            self.offset -= step
            self.sfx_click.play()
            self.refresh()

    def move_right(self, step):
        if self.offset <= len(self.data) - step:
            self.offset += step
            self.sfx_click.play()
            self.refresh()


    def refresh(self):
        self.offset_label.config(text=f"={'='*20} Offset: 0x{self.offset:08X} {'='*20}")
        before = self.data[max(0, self.offset - 16):self.offset]
        current = self.data[self.offset:self.offset+4]
        after = self.data[self.offset+4:self.offset+20]

        full_view = before + current + after
        display_str = ' '.join(f"{b:02X}" for b in full_view)

        self.hex_display.config(state=tk.NORMAL)
        self.hex_display.delete("1.0", tk.END)
        self.hex_display.insert(tk.END, display_str)

        start_byte = max(0, self.offset - 16)
        float_start = (self.offset - start_byte) * 3
        float_end = float_start + 11
        int_start = float_start
        int_end = int_start + 5

        self.hex_display.tag_add("float32", f"1.{float_start}", f"1.{float_end}")
        self.hex_display.tag_add("int16", f"1.{int_start}", f"1.{int_end}")
        self.hex_display.tag_config("float32", background="white", foreground="black")
        self.hex_display.tag_config("int16", background="#88ccff", foreground="#000066")
        self.hex_display.config(state=tk.DISABLED)

        try:
            val = struct.unpack('<f', current)[0]
            self.float_value.config(text=f"Float32: {val:.8f}")
        except:
            self.float_value.config(text="Float32: Invalid")

        try:
            val1 = struct.unpack('<h', current[:2])[0]
            self.int16_value.config(text=f"SignedInt16: {val1}")
        except:
            self.int16_value.config(text="SignedInt16: Invalid")

    def insert_gap_if_needed(self, gap_start):
        if self.last_logged_offset is None and gap_start > 0:
            gap = self.data[0:gap_start]
        elif self.last_logged_offset is not None and gap_start > self.last_logged_offset:
            gap = self.data[self.last_logged_offset:gap_start]
        else:
            gap = b''
        if gap:
            gap_line = ' '.join(f"{b:02x}" for b in gap)
            self.log_lines.append(gap_line)

    def format_with_prefix(self, type_label, offset):
        prefix = ""
        if self.offset_mode.get() == "Write offsets Bytes":
            prefix += f"{offset:08d} | "
        elif self.offset_mode.get() == "Write offsets Hex":
            prefix += f"0x{offset:06X} | "

        if self.output_format.get() == "Create table":
            prefix += f"{type_label} | "

        return prefix

    def save_float(self):
        if self.offset + 4 > len(self.data): return
        chunk = self.data[self.offset:self.offset+4]
        try:
            val = struct.unpack('<f', chunk)[0]
            if abs(val) < 1e-8:
                self.sfx_jam.play()
                return
        except:
            self.sfx_jam.play()
            return
        prefix = self.format_with_prefix("Float32", self.offset)
        if self.last_save_type == 'float' and self.last_logged_offset == self.offset:
            self.log_lines[-1] += f", {val:.8f}"
        else:
            self.insert_gap_if_needed(self.offset)
            self.log_lines.append(prefix + f"{val:.8f}")
        self.last_logged_offset = self.offset + 4
        self.last_save_type = 'float'
        with open(self.log_path, 'w') as f:
            f.write('\n'.join(self.log_lines))
        self.update_log_display()
        self.sfx_ding.play()
        self.offset += 4
        self.refresh()

    def save_int16(self):
        if self.offset + 2 > len(self.data): return
        try:
            val = struct.unpack('<h', self.data[self.offset:self.offset+2])[0]
            if val == 0:
                self.sfx_jam.play()
                return
        except:
            self.sfx_jam.play()
            return
        prefix = self.format_with_prefix("SignedInt16", self.offset)
        if self.last_save_type == 'int16' and self.last_logged_offset == self.offset:
            self.log_lines[-1] += f", {val}"
        else:
            self.insert_gap_if_needed(self.offset)
            self.log_lines.append(prefix + f"{val}")
        self.last_logged_offset = self.offset + 2
        self.last_save_type = 'int16'
        with open(self.log_path, 'w') as f:
            f.write('\n'.join(self.log_lines))
        self.update_log_display()
        self.sfx_ding.play()
        self.offset += 2
        self.refresh()


    def update_log_display(self):
        self.log_display.config(state=tk.NORMAL)
        self.log_display.delete("1.0", tk.END)
        self.log_display.insert(tk.END, '\n'.join(self.log_lines))
        self.log_display.config(state=tk.DISABLED)


if __name__ == "__main__":
    root = tk.Tk()
    app = Float32Trainer(root)
    root.mainloop()
